import React from "react";

const Time = () =>{
    const sec = new Date().getSeconds();
    const min = new Date().getMinutes();
    const hr = new Date().getHours();

    const clock = hr + min + sec;
    return(
       <h1>{clock}</h1>
    )
}

export default Time;
